import React from "react";

import countries from "../../../common/forms/commons/countries";

import SearchDropdown from "./Dropdown";

export default class SearchForm extends React.Component {

  constructor(props) {
    super(props);
    this.dropdownList = [];
  }

  static defaultProps = {
    countries
  };

  onSubmit(e) {
    e.preventDefault();
    console.log("checkout submit stuff");
  }

  render() {
    return ( 
      <form
        id="checkout-form"
        className="smart-form"
        noValidate="novalidate"
        onSubmit={this.onSubmit}
      >
        <fieldset>
          <div className="row">
            <header>
                <span className="widget-icon">
                <i className="fa fa-edit" />
                </span>

                <h2>Search Filters </h2>
            </header>
            <section className="col col-12">
            <label
                className="control-label"
                htmlFor="multiselect1"
                >
                Country
            </label>

            alert(this.props.countries);

            {/* this.props.countries.map((item, key) => {

                    this.props.dropdownList.push({
                        label: item.value,
                        name: item.value,
                        id: item.key,
                        checked: true

                    })
                
            });         

            <SearchDropdown list={this.props.dropdownList} ></SearchDropdown> */}
        
              {/* <label className="select">
                <select 
                name="country"
                multiple="multiple"
                >
                  <option value="0" defaultValue disabled>
                    Country
                  </option>
                  {this.props.countries.map(country => {
                    return (
                      <option
                        key={country.key + country.value}
                        value={country.key}
                      >
                        {country.value}
                      </option>
                    );
                  })}
                </select>{" "}
                <i />{" "}
              </label> */}
            </section>
          </div>
        <div className="row">        
        <section className="col col-4">
              <label className="input">
                <input type="text" name="city" placeholder="City" />
              </label>
        </section>
        </div>
        <div className="row">
        <section className="col col-3">
              <label className="input">
                <input type="text" name="code" placeholder="Post code" />
              </label>
            </section>
        </div>       
        </fieldset>

        <footer>
          <button type="submit" className="btn btn-primary">
            Validate Form
          </button>
        </footer>
      </form>
    );
  }
}
